/* eslint-disable max-len */
import React from 'react';

export default function HomePage() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Penn Buddy
        </p>
      </header>
      <Routes>
        <Route exact path="/" element={<HomePage />} />
      </Routes>
    </div>
  );
}
